import React from 'react';
import { withStyles } from '@material-ui/core/styles';
import landingStyles from '../styles/landingStyles'

const LandingPage = (props) => {
  const classes = props.classes
  return(
    <header>
      <div className='video-container'>
        <video width='100%' autoPlay muted loop className='video'>
          <source src='https://s3.amazonaws.com/jumpcut.com/Spotlight+Video+Banner.mp4' type='video/mp4' />
        </video>
        <div className='video-overlay'/>
      </div>
      <div className='title-container'>
        <h1 className='title'>SUCCESS STORIES</h1>
        <h2 className='subtitle'>How Jumpcut helped them achieve success </h2>
      </div>
    </header>
  )
}

export default withStyles(landingStyles)(LandingPage);
